style.css:
@-moz-document url-prefix("https://denhulster.magister.net/"), url-prefix("https://accounts.magister.net/") {
.content-container {
    background-image: url(http://louis.petven.nl/man.jpeg) !important;
}
.navTrigger {
    background-color: blue !important;
}
.navTrigger:hover {
    background-color: red !important;
}
.header {
    background-color: #33ffb8 !important;
    color: white !important;
    box-shadow: 2px 2px 20px black !important;
}
.header-user, .logoff {
    background-color: #38d29d !important;
}
.head-bar {
    background-color: #ffac3f !important;
}
.edit-layout {
    background-color: #f69618 !important;
}
.podium {
    background-color: #1af0ff !important;
    box-shadow: 0px 200px 0px #1af0ff !important;
    width: 100% !important;
    height: 100% !important;
}
}
